/*
 * This example demonstrates how to use ParallaxScrollView within a ScrollView component.
 */
import React, { Component } from 'react';
import {
  Dimensions,
  Image,
  ListView,
  PixelRatio,
  StyleSheet,
  Text,
  View,
  FlatList,
  ScrollView,
  TouchableHighlight,
  TouchableOpacity,
  TextInput
} from 'react-native';
const {w,h} = Dimensions.get('window');

import ParallaxScrollView from 'react-native-parallax-scroll-view';


class DemoParallaxScrollView extends Component {
  constructor(props) {
    super(props);
    
    //const ds = new ListView.DataSource({rowHasChanged: (r1, r2) => r1 !== r2});
    this.state = {
      arr : [
        {price : '1000',name : 'aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa',key:'1',img:'data:image/jpeg;base64,'},
        {price : '2000',name : 'b',key:'2',img:'data:image/jpeg;base64,'},
        {price : '3000',name : 'c',key:'3',img:'data:image/jpeg;base64,'},
        {price : '4000',name : 'd',key:'4',img:'data:image/jpeg;base64,'}
      ]
    }
  }

  _renderItem({ item, index }){
      
    return(
      <TouchableOpacity onPress={()=>alert(item.name)}>
          <View key={index} style={{margin:10,width:340,height:80,borderBottomWidth:1,borderBottomColor:'black',flexDirection:'row'}}>
            <Image 
                style={{flex:1}}
                source={{uri:item.img}}
            />
            <View style={{flex:3,backgroundColor:'red', justifyContent:'center',alignItems:'center'}}>
                <Text style={{fontSize:20,fontWeight:'bold',color:'#fff'}}>{item.name}</Text>
                <Text style={{fontSize:16,color:'#fff',marginTop:10}}>Giá : {item.price} VNĐ</Text>
            </View>
        </View>
      </TouchableOpacity>
    )

  }

  _renderItem1({ item, index }){
      
    return(
      <View key={index} style={{margin:10,width:340,height:80,flexDirection:'row',alignItems:'center',justifyContent:'center'}}>
          <Image 
              style={{width:40,height:40,borderRadius:20}}
              source={{uri:item.img}}
          />
          <View style={{borderRadius:10,elevation:5,marginLeft:10,flex:1,backgroundColor:'#fff', justifyContent:'center',alignItems:'center',borderWidth:1,borderColor:'blue'}}>
              <Text style={{textAlign:'left',fontSize:20,fontWeight:'bold'}}>{item.name}</Text>
              <Text style={{fontSize:16}}>{item.price}</Text>
          </View>
      </View>
    )

  }

  render() {
    const { onScroll = () => {} } = this.props;
    return (
            <ParallaxScrollView
            onScroll={onScroll}

            headerBackgroundColor="red"
            stickyHeaderHeight={ 40 }
            parallaxHeaderHeight={ 200 }
            backgroundSpeed={10}

            

            renderBackground={() => (
              <View key="background">
                <Image source={{uri: 'https://i.ytimg.com/vi/P-NZei5ANaQ/maxresdefault.jpg',
                                width: window.width,
                                height: 200}}/>
                <View style={{position: 'relative',
                              top: 0,
                              width: window.width,
                              backgroundColor: '#fff',
                              height: 200}}/>
              </View>
            )}

            // renderForeground={() => (
            //   <View key="parallax-header" style={ styles.parallaxHeader }>
            //     {/* <Image style={ styles.avatar } source={{
            //       uri: 'https://pbs.twimg.com/profile_images/2694242404/5b0619220a92d391534b0cd89bf5adc1_400x400.jpeg',
            //       width: AVATAR_SIZE,
            //       height: AVATAR_SIZE
            //     }}/> */}
                
            //   </View>
            // )}

            renderStickyHeader={() => (
              <View key="sticky-header" style={{justifyContent:'center',alignItems:'center',width:w,height:40,backgroundColor:'blue'}}>
                <Text style={{color:'#ffff',fontSize:20,fontWeight:'bold'}}>Thế giới di động</Text>
              </View>
            )}
            
            // renderFixedHeader={() => (
            //   <View key="fixed-header" style={styles.fixedSection}>
            //     <Text style={styles.fixedSectionText}
            //           onPress={() => this.refs.ListView.scrollTo({ x: 0, y: 0 })}>
            //       Scroll to top
            //     </Text>
            //   </View>
            // )}/>
              >
                <View style={{width:w,height:100,backgroundColor:'#3366FF', justifyContent:'center',alignItems:'center'}}>
                  <Text style={ styles.sectionSpeakerText }>
                    Thế giới di động
                  </Text>
                  <Text style={ styles.sectionTitleText }>
                    QL 1k Linh xuân thủ đức
                  </Text>
                </View>
                <View style={{flex:1,backgroundColor:'#fff',alignItems:'center',marginBottom:40}}>
                    <Text style={{marginTop:30,fontSize:20,fontWeight:'bold',color:'blue'}}>Danh sách sản phẩm</Text>
                    <FlatList style={{flex:1}}
                        data={this.state.arr}
                        renderItem={
                            this._renderItem.bind(this)
                        }
                    />
                </View>
                
                <View style={{margin:10,width:340,height:80,flexDirection:'row',alignItems:'center',justifyContent:'center'}}>
                        <Image 
                            style={{width:40,height:40,borderRadius:20}}
                            source={{uri:'data:image/jpeg;base64,'}}
                        />
                        <TextInput 
                            style={{padding:10,elevation:5,marginLeft:10,flex:1,backgroundColor:'#fff', justifyContent:'center',alignItems:'center',borderWidth:1,borderColor:'lightblue'}}
                        />
                </View>
                <View style={{height:50,justifyContent:'center',alignItems:'center'}}>
                  <TouchableOpacity>
                    <Text style={{fontSize:16,fontWeight:'bold',color:'#fff',textAlign:'center',padding:10,borderRadius:5,width:150,height:40,backgroundColor:'green'}}>Thêm bình luận</Text>
                  </TouchableOpacity>
                </View>
                <View style={{flex:1,backgroundColor:'#fff',alignItems:'center'}}>
                    <Text style={{marginTop:30,fontSize:20,fontWeight:'bold',color:'blue'}}>Bình luận</Text>
                    <FlatList style={{flex:1,marginTop:20}}
                        data={this.state.arr}
                        renderItem={
                            this._renderItem1.bind(this)
                        }
                    />
                </View>
            </ParallaxScrollView>
        )}
    //   />
    // );
  //}
}

const window = Dimensions.get('window');

const AVATAR_SIZE = 120;
const ROW_HEIGHT = 60;
const PARALLAX_HEADER_HEIGHT = 350;
const STICKY_HEADER_HEIGHT = 70;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black'
  },
  background: {
    position: 'absolute',
    top: 0,
    left: 0,
    width: window.width,
    height: 200
  },
  stickySection: {
    height: STICKY_HEADER_HEIGHT,
    width: 300,
    justifyContent: 'flex-end'
  },
  stickySectionText: {
    color: 'white',
    fontSize: 20,
    margin: 10
  },
  fixedSection: {
    position: 'absolute',
    bottom: 10,
    right: 10
  },
  fixedSectionText: {
    color: '#999',
    fontSize: 20
  },
  parallaxHeader: {
    alignItems: 'center',
    flex: 1,
    flexDirection: 'column',
    paddingTop: 100
  },
  avatar: {
    marginBottom: 10,
    borderRadius: AVATAR_SIZE / 2
  },
  sectionSpeakerText: {
    color: 'white',
    fontSize: 24,
    paddingVertical: 5
  },
  sectionTitleText: {
    color: 'white',
    fontSize: 18,
    paddingVertical: 5
  },
  row: {
    overflow: 'hidden',
    paddingHorizontal: 10,
    height: ROW_HEIGHT,
    backgroundColor: 'white',
    borderColor: '#ccc',
    borderBottomWidth: 1,
    justifyContent: 'center'
  },
  rowText: {
    fontSize: 20
  }
});

export default DemoParallaxScrollView;
